import Premade from "../pages/Premade";

const SpmLek =  {

    getPremadeGame(id) {
        // Uses Premade.json to get a premade game with id = id
        // Returns all questions in an array
        // Returns null if no game with id = id is found
        for (let i = 0; i < Premade.length; i++) {
            if (Premade[i].id === id) {
                console.log("ID: " + id);
                return Premade[i].questions;
            }
        }
    },
};



export default SpmLek;
